import React from "react";




class News  extends React.Component{
	constructor(){
		super();

		this.state={
			list:[
				{
					aid:"11",
					title:"11"
				},
				{
					aid:"22",
					title:"22"
				},
				{
					aid:"33",
					title:"33"
				},
				{
					aid:"44",
					title:"44"
				}
			]
		}

	}	

	render(){
		return (
			<div>
				"我是News"
				<ul>
					this.state.list.map((value,key)=>{
						 (
							<li>
								<Link to="/content">{value.title}</Link>
							</li>
						)
					})
				</ul>
			</div>
		)
	}    

}

export default News;
